%[text] %[text:anchor:T_8DE76CDD] # **Spider Chart Examples**
%[text] **Overview**
%[text] The `SpiderChart` manages the display of data measuring several distinct numeric variables recorded from one or more subjects. The chart backdrop is a "web" comprising a series of concentric regular polygons and angular rays.
%[text] The chart data comprises a numeric matrix `Data` of size $p\\times q$, where:
%[text] - $p$ is the number of numeric variables (equal to the number of vertices and edges in the polygons),
%[text] - $q$ is the number of subjects (equal to the number of data lines on the chart). \
%[text] Each row of the chart data represents a variable, and each column represents a complete set of measurements for one subject. Each measured value lies between 0 and 1, which allows distinct variables to be compared easily. To display measured values not lying in the range $\[0, 1\]$, the input data matrix should be rescaled on a columnwise basis. For ease of comparison, the chart backdrop has 10 concentric polygons with radii $r=0.1, 0.2, \\dots, 0.9, 1$.
%[text] We impose the constraint $3\\leq p\\leq 20$ on the number of variables. The lower bound $p\\geq 3$ ensures that the chart backdrop has at least 3 nodes, i.e., that the web is at least triangular. The upper bound $p\\leq 20$ is purely for visual reasons and ensures that the chart backdrop has at most 20 nodes and does not become too cluttered. There is no restriction on the number of lines $q$, but in practice the chart becomes tricky to read if $q$ is too large.
%[text] There is also an additional chart data property `TargetData` of size $p\\times 1$. These values are plotted on the web using a separate line object, which can be toggled on or off as required. Visualizing the `TargetData` property allows the observed data measurements to be compared against their target values. As above, the target data should lie in the range $\[0, 1\]$.
%[text] ![SpiderChart.png](text:image:48fe)
%[text] **Documentation**
%[text] - [`line`](<matlab: doc("line")>): Create primitive line \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_64440A8C] ## Generate sample chart data for one subject.
%[text] Let's start with one subject and assume that there are five measured variables.
rng( "default" )
data = rand( 5, 1 );
%[text] Define the node labels.
labels = "Property " + (1:numel( data ));
%%
%[text] %[text:anchor:H_B1338D8C] ## Create a figure for the chart.
f = exampleFigure( "Name", "SpiderChart Example" ); %[output:36a0eaa4]
%%
%[text] %[text:anchor:H_4CDE434B] ## Create the chart.
SC = SpiderChart( "Parent", f, ... %[output:group:1ffdc7a0] %[output:36a0eaa4]
    "Data", data, ... %[output:36a0eaa4]
    "LabelText", labels ); %[output:group:1ffdc7a0] %[output:36a0eaa4]
%%
%[text] %[text:anchor:H_E2C28881] ## Annotate the chart.
%[text] The `Spider` chart has the `title` and `legend` methods for annotation.
title( SC, "Spider Chart", "FontSize", 14 ) %[output:1e145c6d]
%%
%[text] %[text:anchor:H_DBCB04FB] ## Add target data and customize the appearance of the target line.
%[text] We can add a target data vector to the chart.
SC.TargetData = 0.35 * ones( SC.NumNodes, 1 ); %[output:164ba695]
%[text] Customize the appearance of the target line.
set( SC, "TargetVisible", "on", "TargetLineWidth", 2 ) %[output:164ba695]
%%
%[text] %[text:anchor:H_3FC08A90] ## Hide the target line.
SC.TargetVisible = "off"; %[output:1d8d2316]
%%
%[text] %[text:anchor:H_7D8CBD09] ## Decrease the number of observed variables.
SC.Data = [0.1; 0.3; 0.5; 0.7]; %[output:6f6f3734]
%%
%[text] %[text:anchor:H_1ED6E269] ## Increase the number of observed variables.
rng( "default" )
SC.Data = rand( 8, 1 ); %[output:28468ef8]
%%
%[text] %[text:anchor:H_FE990B2A] ## Update the labels.
SC.LabelText = ["A", "B", "C", "D", "E", "F", "G", "H"]; %[output:90b85364]
%%
%[text] %[text:anchor:H_863F90C5] ## Increase the number of subjects.
%[text] The number of subjects is defined by the number of columns in the chart data matrix.
SC.Data = rand( 8, 4 ); %[output:544e4793]
%%
%[text] %[text:anchor:H_008EF0CC] ## Decrease the number of observed variables.
SC.Data = SC.Data(1:5, :); %[output:32d1ac2d]
%%
%[text] %[text:anchor:H_EF68455B] ## Add a legend.
legend( SC, "Subject " + (1:SC.NumLines) ) %[output:830c4510]
%%
%[text] %[text:anchor:H_A3EEAFF4] ## Update the target data.
set( SC, "TargetData", 0.55 * ones( SC.NumNodes, 1 ), ... %[output:group:4a37db9b] %[output:9f2ff2b4]
    "TargetVisible", "on" ) %[output:group:4a37db9b] %[output:9f2ff2b4]
%%
%[text] %[text:anchor:H_AB9CE79E] ## Customize the visual appearance of the chart.
set( SC, "LineColors", hsv( SC.NumLines ), ... %[output:group:907147a4] %[output:1a2edc90]
    "LineWidth", 3, ... %[output:1a2edc90]
    "LabelFontWeight", "bold", ... %[output:1a2edc90]
    "LabelFontSize", 12, ... %[output:1a2edc90]
    "LabelFontAngle", "italic" ) %[output:group:907147a4] %[output:1a2edc90]
%%
